  input: TEXT,"F3XA","","This amendment is in response to the Commissions letter dated
    01/19/2007. Column B totals of the Detailed Summary Page for Lines 11(a)(i) and
    11(a)(ii) have been corrected. The totals listed on Lines 21(b) and 30 (b) have
    been corrected. The payment for Voter File Update had been moved to Schedule B
    for Line 30(b). The payment disclosed on Schedule B, in the amount of $14,490.00
    was originally disclosed on Line 29 on the original report filed for the period.
    It is still disclosed on Schedule B for Line 29. This transfer to the Committee's
    non-federal account was to correct a banking error in which the Committee's bank
    transferred a duplicate amount for an allocation transfer that was submitted in
    June. The Committee disclosed two allocation transfers on Schedule H3 for the
    July Monthly Report, and this transaction serves to correct the bank's mistaken
    transfer. The Committee disclosed payments for Salaries/Wages for this period
    on Schedule H4 for Line 21a, and Schedule B for Line 30b.  The Committee pays
    its employees with 100% federal funds, and disclosed the expenditures on Line
    30b when the individual spends more than 25% of their compensated time in a given
    month on Federal election activity or activities in connection with a Federal
    election.  Those individuals who spend 25% or less of their compensated time in
    a given month on Federal election activity or activities in connection with a
    Federal election are paid with Federal funds, and allocated on Schedule H4.  In
    either case, all amounts spent for employee specific 'fringe benefits,' consisting
    of health insurance, disability insurance, life insurance, retirement benefits
    and payroll taxes are paid for, and reported on a proportional basis equal to
    the amount associated with the individual that received the compensation and the
    funds with which the individual was paid.  Any reimbursements/allocation transfers
    to the Committee's federal account from the Committee's non-federal account for
    salaries, and/or benefits are associated with individuals whose activities do
    not exceed 25% in a given month.  Memo texts have been provided to clarify the
    description of payroll processing fees.  These are service fees for payroll processing
    such as filing taxes and cutting checks, not a salary payment for an individual(s).  Payments
    on Schedule B for the JJ dinner, Century Club Breakfast, Fundraising Sign Printing
    and Fundraising Programs did not refer to any specific candidate for federal office.   Payments
    for Federal fundraising on Schedule B were federal fundraising events for the
    Committee and were not for any specific candidate for federal office.  MEMO entries
    for itemization of disbursements disclosed on  Schedule H4 for Line 21(a) have
    been provided. The Committee paid stipends for cell phones to individuals. However,
    the individual service providers are unknown by the Committee. The stipends were
    paid to the individuals to offset a portion of the costs incurred for increased
    cell phone usage."
